Hey Tough Guy! (Barbie), 2023
Flashe paint, gesso, graphite, colored pencil on hand-cut paper
50.5 x 39 in

@michaelscogginsart #michaelscoggins #contemporaryart #laneycontemporary #barbie #thepunisher #pink

A look back at the WTOC Morning Break segment with Michael Scoggins ~ Art has historically granted a chance to see, hear, or feel another person’s pain or joy, protest or private reflection. It can also share, inform, and advocate. Like a portal, a letter or a sketch, a work of art can grant an opening into someone’s world, strengthening unseen bonds between artist and viewer; the bonds that grant us our humanity.

